import React from 'react';
import './MainPage.css'
import Post from "../Post/Post";

function Mainpage() {

    let data = [
        {
            id:'1234',
            userName:'asd',
            postImage:'https://hatrabbits.com/wp-content/uploads/2017/01/random.jpg',
            likes:'1234',
            commentList: [
                {
                    "userName": "ASDS",
                    "commentId":"1234",
                    "timeStamp":"123456",
                    "description":"Comment 1"
                },
                {
                    "userName": "ASDS",
                    "commentId":"1234",
                    "timeStamp":"123456",
                    "description":"Comment 1"
                },
                {
                    "userName": "ASDS",
                    "commentId":"1234",
                    "timeStamp":"123456",
                    "description":"Comment 1"
                }
            ]
        }
    ]
  return (
    <div>
        <Post post={data[0]} />
        <Post post={data[0]} />
        <Post post={data[0]} />
        <Post post={data[0]} />

    </div>
  );
};

export default Mainpage;
